import React from 'react';
import './App.css'; // Importing the app-wide CSS file
import FileUploadForm from './components/FileUploadForm'; // Importing the form component

function App() {
    return (
        <div className="App">
            <h1>File Upload Application</h1>
            <FileUploadForm /> {/* Rendering the file upload form */}
        </div>
    );
}

export default App;
